import React from 'react';

const ProfessionalSkills = () => {
    return (
        <div className='prof-skills'>
           
            <div className='prof-skills-title'>Professional Skills</div>
            <div className='prof-skill-square-left'>
                <div className='prof-skill-content'>
                <p>HTML & CSS</p> <p>90%</p>                
                </div>
                <div className = 'prof-skill-gradient-1'>90%</div>
                <p>Wordpress</p>
                <div className = 'prof-skill-gradient-2'>75%</div>
                <p>JavaScript</p>
                <div className = 'prof-skill-gradient-3'>85%</div>
                <p>React</p>
                <div className = 'prof-skill-gradient-4'>70%</div>
                <p>Figma</p>
                <div className = 'prof-skill-gradient-5'>65%</div>
            </div>
            
        </div>
    );
};

export default ProfessionalSkills;
